import axios from 'axios';

const API = axios.create({ baseURL: 'http://localhost:8000/api' });

export const fetchComponents = () => API.get('/components/');
export const fetchVehicles = () => API.get('/vehicles/');
export const fetchIssues = () => API.get('/issues/');
export const createComponent = (newComponent) => API.post('/components/', newComponent);
export const createVehicle = (newVehicle) => API.post('/vehicles/', newVehicle);
export const createIssue = (newIssue) => API.post('/issues/', newIssue);
